from time import time


class Solution:
    def numSubarrayProductLessThanK(self, nums: list[int], k: int) -> int:
        # first solution
        result = 0
        cur_product = 1
        i = j = 0
        while i < len(nums) and j < len(nums):
            new_product = cur_product * nums[j]
            if new_product < k:
                result += (j - i + 1)
                cur_product = new_product
                j += 1
            else:
                cur_product /= nums[i]
                i += 1
        return result

        """ LC solution
        if k <= 1: return 0
        prod = 1
        ans = left = 0
        for right, val in enumerate(nums):
            prod *= val
            while prod >= k:
                prod /= nums[left]
                left += 1
            ans += right - left + 1
        return ans
        """

